import React from "react";
import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Bio from "./components/Bio/Bio";
import Skills from "./components/Skills/Skills";

function App() {
  return (
    <div className="App">
      <Bio name="Abdul Hay1" />
      <Skills />
    </div>
  );
}

export default App;
